        if len(set(arr)) == 1:
            return 0

        min_d = min(arr)
        max_d = max(arr)

        if max_d - min_d > n:
            return -1

        for i in range(min_d, max_d + 1):
            new_arr = [x - i for x in arr]
            if len(set(new_arr)) == 1:
                return i

        return -1

    result = check_min_d(arr, n)
    return str(result)

