        intersections = []
        for i in range(len(segments)):
            for j in range(i + 1, len(segments)):
                l1, r1 = segments[i]
                l2, r2 = segments[j]
                if l2 <= l1 <= r2 or l2 <= r1 <= r2:
                    intersection_start = max(l1, l2)
                    intersection_end = min(r1, r2)
                    if intersection_start <= intersection_end:
                        intersections.append((intersection_start, intersection_end))

        if not intersections:
            return 0

        max_length = 0
        for intersection in intersections:
            length = intersection[1] - intersection[0] + 1
            if length > max_length:
                max_length = length

        return max_length

    max_length = 0
    for i in range(len(segments)):
        remaining_segments = segments[:i] + segments[i+1:]
        current_length = max_intersection_length(remaining_segments)
        if current_length > max_length:
            max_length = current_length

    return str(max_length)


