    n, s = stdin.split()
    n = int(n)
    MOD = 1000000007

    def is_regular(bracket_sequence: str) -> bool:
        stack = []
        for char in bracket_sequence:
            if char == '(':
                stack.append(char)
            elif char == ')':
                if not stack or stack[-1] == ')':
                    return False
                stack.pop()
        return not stack

    def count_bracket_sequences(length: int, substring: str) -> int:
        count = 0
        for i in range(length - len(substring) + 1):
            bracket_sequence = "()" * i + substring + "()" * (length - len(substring) - i)
            if is_regular(bracket_sequence):
                count += 1
        return count

    return str(count_bracket_sequences(2 * n, s) % MOD)

