    def modular_inverse(a: int, b: int) -> int:
        b0, x0, y0 = b, 0, 1
        b1, x1, y1 = a, 1, 0
        while b1 != 0:
            q = b0 // b1
            b0, b1 = b1, b0 - q * b1
            x0, x1 = x1, x0 - q * x1
            y0, y1 = y1, y0 - q * y1
