    n, m = map(int, stdin.split())
    edges = [tuple(map(int, line.split())) for line in stdin.split('\n')[1:]]

    # Check if the graph is connected
    def is_connected(graph, n, visited, node):
        visited[node] = True
        for neighbor in graph[node]:
            if not visited[neighbor]:
                is_connected(graph, n, visited, neighbor)

    graph = [[] for _ in range(n)]
    for a, b in edges:
        graph[a-1].append(b-1)
        graph[b-1].append(a-1)

    visited = [False] * n
    is_connected(graph, n, visited, 0)
    if any(not visited):
        return str(0)

    # Check if the edge is a bridge
    def dfs(node, parent, graph, n, visited, low, pre, bridges):
        visited[node] = True
        for neighbor in graph[node]:
            if neighbor != parent:
                if not visited[neighbor]:
                    low[node] = min(low[node], dfs(neighbor, node, graph, n, visited, low, pre, bridges))
                    if pre[node] < low[neighbor]:
                        bridges[node] = bridges.get(node, 0) + 1
                else:
                    low[node] = min(low[node], pre[neighbor])
        pre[node] = low[node]
        return low[node]

    low = [float('inf')] * n
    pre = [-1] * n
    bridges = {}

    dfs(0, -1, graph, n, [False] * n, low, pre, bridges)
    return str(sum(bridges.values()))

