    dp = [0] * (n+1)
    mod = 10**9+7

    # Base cases
    dp[0] = 1
    if n == 1:
        return str(dp[0])

    # Fill the dp table
    for i in range(1, n+1):
        if i == 1:
            dp[i] = k
        elif i == 2:
            dp[i] = k * (k-1)
