    grid = [list(line) for line in lines[1:]]
    words = []

    def dfs(row, col, word):
        if row < 0 or row >= R or col < 0 or col >= C:
            return
        if grid[row][col] == '#':
            return
        if grid[row][col] == ' ':
            return

        if len(word) >= 2:
            words.append(word + grid[row][col])

        dfs(row - 1, col, word + grid[row][col])
        dfs(row, col - 1, word + grid[row][col])
        dfs(row + 1, col, word + grid[row][col])
        dfs(row, col + 1, word + grid[row][col])

    for i in range(R):
        for j in range(C):
            dfs(i, j, '')

    return min(words)

