def solution(stdin: str) -> str:
    # Read the input
    t, N, M = map(int, stdin.split()[:3])
    grid = [list(line.strip()) for line in stdin.split()[3:]]

    # Find the starting position
    for i in range(N):
        for j in range(M):
            if grid[i][j] == 'S':
                start = (i, j)
                break

    # Initialize visited and distances
    visited = set()
    distances = [[float('inf')] * M for _ in range(N)]
    distances[start[0]][start[1]] = 0

    # Dijkstra's algorithm
    queue = [(start, 0)]
    while queue:
        (i, j), dist = queue.pop(0)
        if (i, j) in visited:
            continue
        visited.add((i, j))

        # Check if we reached the border
        if i == 0 or i == N - 1 or j == 0 or j == M - 1:
            if dist <= t:
                return str(dist)

        # Check the neighbors
        for di, dj in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            ni, nj = i + di, j + dj
            if 0 <= ni < N and 0 <= nj < M:
                if grid[ni][nj] == '1':
                    continue
                if (ni, nj) in visited:
                    continue
                if distances[i][j] + 1 < distances[ni][nj]:
                    distances[ni][nj] = distances[i][j] + 1
                    queue.append(((ni, nj), distances[ni][nj]))

    # If we still haven't escaped, print "NOT POSSIBLE"
    return "NOT POSSIBLE"

