def solution(stdin: str) -> str:
    """
    Finds the minimum number of characters to remove from a string to make it a Peragram.

    :param stdin: Input string.
    :return: Minimum number of characters to remove.
    """
    # Remove non-alphabetic characters
    stdin = ''.join(filter(str.isalpha, stdin))
    # Get all possible substrings
    substrings = [stdin[i:j] for i in range(len(stdin)) for j in range(i + 1, len(stdin) + 1)]
    # Count palindromes and their lengths
    palindromes = {}
    for substring in substrings:
        if substring == substring[::-1]:
            palindromes[substring] = len(substring)
    # Find peragrams
    peragrams = []
    for substring in substrings:
        if len(set(stdin) - set(substring)) <= max(palindromes.values()):
            peragrams.append(substring)
    # Return minimum peragram length
    return min(map(len, peragrams), default=0)

