            add_next_water(row + 1, col)
            add_next_water(row, col - 1)
            add_next_water(row, col + 1)

    while next_water:
        row, col = next_water.pop(0)
        if grid[row][col] == "V" and (row == 0 or grid[row - 1][col] == "."):
            result[row][col] = "V"
            add_next_water(row, col - 1)
            add_next_water(row, col + 1)
        elif grid[row][col] == "#":
            add_next_water(row - 1, col)
            add_next_water(row + 1, col)

    return "\n".join(["".join(line) for line in result])

